<script>
  var license_key = '';
  var db_check_count = 0;
  var db_check_count_max = 30;

  $('.modal.draggable>.modal-dialog').draggable({
    cursor: 'move',
    handle: '.modal-header'
  });
  // $('.modal.draggable>.modal-dialog>.modal-content>.modal-header').css('cursor', 'move');

  function login(event) {
    event.preventDefault();

    if ($('#web-user').val() == "") {
      $('#empty-user').html("\xec\x95\x84\xec\x9d\xb4\xeb\x94\x94\xeb\xa5\xbc \xec\x9e\x85\xeb\xa0\xa5\xed\x95\xb4\xec\xa3\xbc\xec\x84\xb8\xec\x9a\x94.");
      $('#empty-pass').html("");
      return false;
    }
    else {
      $('#empty-user').html("");
    }
    if ($('#web-pass').val() == "") {
      $('#empty-user').html("");
      $('#empty-pass').html("\xec\x95\x94\xed\x98\xb8\xeb\xa5\xbc \xec\x9e\x85\xeb\xa0\xa5\xed\x95\xb4\xec\xa3\xbc\xec\x84\xb8\xec\x9a\x94.");
      return false;
    }
    else {
      $('#empty-pass').html("");
    }

    var login_json = {
      web_user: $('#web-user').val(),
      web_pass: $('#web-pass').val(),
    };
    var login_info = JSON.stringify(login_json);
    // var key = '';
    // var iv = '';
    // $.ajax({
    //   url: "/get_key",
    //   type: "post",
    //   success: function (response) {
    //     var data_json = JSON.parse(response);

    //     if (data_json['exitcode'] == 1) {
    //       key = CryptoJS.enc.Utf8.parse(data_json['key']);
    //       iv = CryptoJS.enc.Utf8.parse(data_json['iv']);
    //     }
    //   }
    // });
    // var login_info_enc = CryptoJS.AES.encrypt(login_info, key, {
    //   mode: CryptoJS.mode.CBC, padding: CryptoJS.pad.ZeroPadding, iv: iv
    // });
    var login_info_enc = generate_random_string(128) + Base64.encode(login_info);

    login_check(login_info_enc);
  }

  function login_check(login_info_enc) {
    $('#login-button').attr('disabled', true);
    $('#db-check-span').addClass("spinner-border spinner-border-sm");

    $.ajax({
      url: "/db_check",
      type: "post",
      success: function (response) {
        var data_json = JSON.parse(response);

        if ((data_json['exitcode'] == 1) && data_json['db_status']) {
          $.ajax({
            url: "/login_check",
            type: "post",
            data: {
              login_info_enc: login_info_enc,
            },
            success: function (response) {
              var data_json = JSON.parse(response);

              if (data_json['exitcode'] == 0) {
                window.location.href = 'scan';
              }
              else {
                $('#db-check-span').removeClass("spinner-border spinner-border-sm");
                $('#login-button-text').text("\xeb\xa1\x9c\xea\xb7\xb8\xec\x9d\xb8");
                $('#login-button').attr('disabled', false);

                if (data_json['exitcode'] == 6) {
                  if (data_json['redirect_msg'] == 'change_password') {
                    $('#new-password-input-password').val('');
                    $('#new-password-re-input-password').val('');
                    $('#empty-new-password').html('');
                    $('#empty-new-password-re').html('');
                    $('#pw-change-modal').modal('show');
