                  //   $('#license-change-modal .web-message').text(data_json['msg_detail']);
                  //   $('#license-change-modal').modal('show');
                  // }
                }
                else {
                  $('#login-modal-title').text(data_json['msg']);
                  $('#login-modal-body').text(data_json['msg_detail']);
                  $('#login-modal').modal('show');
                }
              }
            }
          });
        }
        else {
